import{_ as a,c as e,o,ae as r}from"./chunks/framework.COrXKI8X.js";const d="/searobot-docs/images-searobot/media/image1.png",i="/searobot-docs/images-searobot/media/image2.png",m=JSON.parse('{"title":"SeaRobot 01 产品简介","description":"","frontmatter":{},"headers":[],"relativePath":"searobot/introduction.md","filePath":"searobot/introduction.md"}'),l={name:"searobot/introduction.md"};function h(n,t,s,b,c,u){return o(),e("div",null,t[0]||(t[0]=[r('<h1 id="searobot-01-产品简介" tabindex="-1">SeaRobot 01 产品简介 <a class="header-anchor" href="#searobot-01-产品简介" aria-label="Permalink to &quot;SeaRobot 01 产品简介&quot;">​</a></h1><p><img src="'+d+'" alt="SeaRobot 01"></p><h2 id="产品概述" tabindex="-1">产品概述 <a class="header-anchor" href="#产品概述" aria-label="Permalink to &quot;产品概述&quot;">​</a></h2><p>SeaRobot 01 系列无人车是一款基于室内外全地形的自主移动机器人底盘，其主要针对室外越野、农业、园区等场景。SeaRobot 01 系列无人车适配四套直流无刷伺服电机，四个轮子均可以独立控制速度。整车VCU 基于ARM的控制板，不但可以控制车辆运动行驶，还能直接反馈各个轮子速度，电量电压和相关的车辆状态。</p><p>SeaRobot 01 系列无人车支持巡航点设置和绘制功能、轨迹点设置功能和轨迹录制功能、地图构建与地图切换、激光自动回充功能以及后台管理等。</p><p><img src="'+i+'" alt="SeaRobot 01 外观"></p><h2 id="产品优势和特点" tabindex="-1">产品优势和特点 <a class="header-anchor" href="#产品优势和特点" aria-label="Permalink to &quot;产品优势和特点&quot;">​</a></h2><h3 id="多地形适应-无惧复杂环境" tabindex="-1">多地形适应，无惧复杂环境 <a class="header-anchor" href="#多地形适应-无惧复杂环境" aria-label="Permalink to &quot;多地形适应，无惧复杂环境&quot;">​</a></h3><p>SeaRobot 01 系列底盘载四套独立控制直流无刷伺服电机，四轮独立驱动，精准分配动力，兼顾稳定性与通过性，适应室内外多场景切换需求。</p><h3 id="强劲动力与精准控制" tabindex="-1">强劲动力与精准控制 <a class="header-anchor" href="#强劲动力与精准控制" aria-label="Permalink to &quot;强劲动力与精准控制&quot;">​</a></h3><p>通过先进的运动控制算法，SeaRobot 01 系列，以ARM 架构整车VCU 控制系统，实时监控车辆状态（轮速、电量、电压等），动态调节动力输出，确保运行稳定性。支持差速转向、原地旋转等灵活运动模式。</p><h3 id="智能导航与自主作业" tabindex="-1">智能导航与自主作业 <a class="header-anchor" href="#智能导航与自主作业" aria-label="Permalink to &quot;智能导航与自主作业&quot;">​</a></h3><p>SeaRobot 01 多模态导航功能：</p><ul><li>激光SLAM 建图：快速构建厘米级精度2D 地图，支持增量更新，动态适应环境变化</li><li>巡航点设置、轨迹录制、轨道点规划：一键部署巡检路线，支持循环任务与路径记忆</li><li>激光末端定位+自动回充：任务完成后自动返回充电桩，实现7×24 小时无人值守作业</li></ul><h3 id="超长续航与大载重设计" tabindex="-1">超长续航与大载重设计 <a class="header-anchor" href="#超长续航与大载重设计" aria-label="Permalink to &quot;超长续航与大载重设计&quot;">​</a></h3><ul><li>80KG 超大载重，可搭载机械臂、传感器、货箱等多种设备，满足农业运输、物资配送等需求</li><li>3 小时长续航+电池快拆设计，电池快速更换，使作业无缝衔接</li><li>多路电压输出（48V/24V/19V/12V），直接为外设供电，减少额外电源配置</li></ul><h3 id="高度灵活-支持深度定制" tabindex="-1">高度灵活，支持深度定制 <a class="header-anchor" href="#高度灵活-支持深度定制" aria-label="Permalink to &quot;高度灵活，支持深度定制&quot;">​</a></h3><p>提供软硬件开放接口，可适配用户定制化功能模块（如喷洒系统、监测设备等）。底盘结构支持扩展改造，满足不同场景的机械安装与功能集成需求。</p><h2 id="产品配件清单" tabindex="-1">产品配件清单 <a class="header-anchor" href="#产品配件清单" aria-label="Permalink to &quot;产品配件清单&quot;">​</a></h2><h3 id="底盘配件清单" tabindex="-1">底盘配件清单 <a class="header-anchor" href="#底盘配件清单" aria-label="Permalink to &quot;底盘配件清单&quot;">​</a></h3><table tabindex="0"><thead><tr><th>配件名称</th><th>数量</th></tr></thead><tbody><tr><td>SeaRobot 01 机器人本体</td><td>1 套</td></tr><tr><td>锂电池充电器（AC220V）</td><td>1 套</td></tr><tr><td>对外供电模块</td><td>1 套</td></tr><tr><td>2.4G 航模遥控器</td><td>1 套</td></tr><tr><td>供电插头</td><td>1 套</td></tr></tbody></table><h3 id="激光导航清单" tabindex="-1">激光导航清单 <a class="header-anchor" href="#激光导航清单" aria-label="Permalink to &quot;激光导航清单&quot;">​</a></h3><table tabindex="0"><thead><tr><th>配件名称</th><th>数量</th><th>配件名称</th><th>数量</th></tr></thead><tbody><tr><td>激光导航主机</td><td>1 套</td><td>自动回充模块</td><td>1 套</td></tr><tr><td>16 线激光雷达</td><td>1 套</td><td>工业路由器</td><td>1 套</td></tr></tbody></table>',23)]))}const _=a(l,[["render",h]]);export{m as __pageData,_ as default};
